const additionalInfo = (repos: number) => {
    let repoText =
        repos === 0
            ? "No Public Repos Found"
            : repos === 1
            ? "1 Public Repo:"
            : `${repos} Pupil Repos:`;
    let date = new Date();
    console.log(date);
    return { repoCount: repoText, data: "date and time here" };
};

export { additionalInfo };
